import axios from 'axios';
import { useParams } from 'react-router-dom';
const BASE_URL = 'http://localhost:8000'; // Replace this with your actual backend API URL

const ProjectService = {
    getProjects: async () => {
        try {
            const { userId } = useParams();
            const response = await axios.get(`${BASE_URL}/students/projectBank/${userId}`); // Replace ":userId" with the actual user ID
            return response.data;
        } catch (error) {
            console.error('Error fetching projects:', error);
            return [];
        }
    }
};

export default ProjectService;
